import React from 'react'
import ParticleBackground from '../ParticleBackground'
import { IntroPageCont, TitleCardCont, IntroductionCont, LinksCont, NameCont, ResumeButton,
IntroStart, IntroEnd, IconButton, ThemeCont } from '../Components/IntroPage/IntroPage.elements'
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import LightModeIcon from '@mui/icons-material/LightMode';
import DarkModeIcon from '@mui/icons-material/DarkMode';

function IntroPage({ changeTheme, colorTheme, darkTheme, lightTheme}) {
  return (
      <IntroPageCont id='IntroPage'>
        <ThemeCont>
          {(colorTheme === darkTheme) ? <IconButton onClick={changeTheme}><LightModeIcon /></IconButton> :
                                         <IconButton onClick={changeTheme}><DarkModeIcon /></IconButton>}
          {/* {(colorTheme === lightTheme) && <IconButton onClick={changeTheme}><DarkModeIcon /></IconButton>} */}
        </ThemeCont>
        <TitleCardCont>
          <IntroductionCont>
            <IntroStart>Hey, I'm</IntroStart>
            <NameCont>Aeron Horne,</NameCont>
            <IntroEnd>Web Developer.</IntroEnd>
          </IntroductionCont>
          <LinksCont>

            <IconButton><GitHubIcon /></IconButton>

            <IconButton><LinkedInIcon /></IconButton>

            <ResumeButton>Resume</ResumeButton>
            
          </LinksCont>
        </TitleCardCont>
          <ParticleBackground colorTheme={colorTheme}/>
      </IntroPageCont>
  )
}

export default IntroPage
